import React from 'react';

const Terms = () => {
    return (
        <div>
            <h1>Terms and Conditions</h1>
            <p>Welcome to our Terms and Conditions page. Please read these terms carefully before using our website.</p>
            <h2>1. Introduction</h2>
            <p>These terms and conditions govern your use of this website; by using this website, you accept these terms and conditions in full.</p>
            <h2>2. License to use website</h2>
            <p>Unless otherwise stated, we or our licensors own the intellectual property rights in the website and material on the website.</p>
            <h2>3. Acceptable use</h2>
            <p>You must not use this website in any way that causes, or may cause, damage to the website or impairment of the availability or accessibility of the website.</p>
            <h2>4. Restricted access</h2>
            <p>Access to certain areas of this website is restricted. We reserve the right to restrict access to other areas of this website, or indeed this entire website, at our discretion.</p>
            <h2>5. Variation</h2>
            <p>We may revise these terms and conditions from time-to-time. Revised terms and conditions will apply to the use of this website from the date of the publication of the revised terms and conditions on this website.</p>
            <h2>6. Entire agreement</h2>
            <p>These terms and conditions constitute the entire agreement between you and us in relation to your use of this website, and supersede all previous agreements in respect of your use of this website.</p>
        </div>
    );
};

export default Terms;
